import React from 'react';
import {useSpring, useTransition, animated} from 'react-spring'
import logo from './logo.png'
import {Link} from "react-router-dom";

function App() {
    const props = useSpring({
        opacity: 5,
        from: {opacity:0},
        config:{mass:30, tension:1, friction: 100}

    })
    const [items, set] = useState()
const transitions = useTransition(items, item => item.key, {
from: { transform: 'translate3d(0,-40px,0)' },
enter: { transform: 'translate3d(0,0px,0)' },
leave: { transform: 'translate3d(0,-40px,0)' },
})
    return  transitions.map(({ item, props, key }) =>
        <div>
             <animated.img className="btn"src={logo} style={props}>
        </animated.img>
        <animated.div style={props} className="viewpoint-header">
                    <Link className="viewpoint-header2" to="./about"> about     +</Link>
                        <Link className="viewpoint-header2" to="./portfolio">portfolio     +</Link>

                        <Link className="viewpoint-header2" to="./products">  shop </Link>
                </animated.div>
        </div>
    )

}

export default App;
